<link>http://78.46.73.113/wiki/wakka.php?wakka=DokumentacijaIPStudioAMBS/RazdelOperatory/RazdelEditOperators/PrimerDobavlenieNovogoShljuza/show&amp;time=2006-12-16+21%3A34%3A20</link>
<description>&lt;div class="pageBefore">&lt;img src="http://78.46.73.113/wiki/images/z.gif" width="1" height="1" border="0" alt="" style="display:block" align="top" />&lt;/div>&lt;div class="page">
&lt;b>Сравнение версий &lt;a  href="http://78.46.73.113/wiki/wakka.php?wakka=DokumentacijaIPStudioAMBS/RazdelOperatory/RazdelEditOperators/PrimerDobavlenieNovogoShljuza&amp;amp;v=yt3" class="">/Документация&amp;nbsp;IP&amp;nbsp;Studio&amp;nbsp;AMBS&amp;nbsp;/&amp;nbsp;Раздел&amp;nbsp;Операторы&amp;nbsp;/&amp;nbsp;Раздел&amp;nbsp;Edit&amp;nbsp;Operators&amp;nbsp;/&amp;nbsp;Пример&amp;nbsp;Добавление&amp;nbsp;Нового&amp;nbsp;Шлюза&lt;/a> за &lt;a href="http://78.46.73.113/wiki/wakka.php?wakka=DokumentacijaIPStudioAMBS/RazdelOperatory/RazdelEditOperators/PrimerDobavlenieNovogoShljuza&amp;amp;time=2006-12-16+21%3A34%3A20">2006-12-16 21:34:20&lt;/a> и &lt;a href="http://78.46.73.113/wiki/wakka.php?wakka=DokumentacijaIPStudioAMBS/RazdelOperatory/RazdelEditOperators/PrimerDobavlenieNovogoShljuza&amp;amp;time=2006-12-16+21%3A38%3A53">2006-12-16 21:38:53&lt;/a>&lt;/b>&lt;br />
&lt;br />
&lt;b>Добавлено:&lt;/b>&lt;br />
&lt;div class="additions">&lt;u>Замечание&lt;/u>:&lt;br />
1. Каждый новый шлюз должен иметь свой уникальный идентификатор (Gateway ID).&lt;br />
2. Если новый шлюз не&amp;nbsp;добавился, внимательно прочитайте сообщение, которое выдает система при&amp;nbsp;попытки добавить этот шлюз. &lt;br />
Возможно в&amp;nbsp;системе уже&amp;nbsp;имеется аналогичный шлюз, в&amp;nbsp;этом случае нужно добавлять шлюз с&amp;nbsp;использованием правила &amp;laquo;использования одного ip-адреса несколько раз&amp;raquo;.&lt;br />
3. Если при&amp;nbsp;добавлении шлюза вам&amp;nbsp;не&amp;nbsp;известны некоторые из&amp;nbsp;параметров работы шлюза, вы&amp;nbsp;можете оставить параметры предлагаемые по&amp;nbsp;умолчанию (или сделать шлюз не&amp;nbsp;активным) и&amp;nbsp;добавить его&amp;nbsp;в&amp;nbsp;систему. В&amp;nbsp;последствии, после уточнения всех дополнительных параметров шлюза их&amp;nbsp;можно будет добавить через режим редактирования шлюза.&lt;/div>&lt;/div>
</description>
